const $ = document.querySelector.bind(document);
const $$ = document.querySelectorAll.bind(document);
const playList = $('.playlist');
const cd = $('.cd');
let indexSong = 0;
let currentSong = songs[indexSong];
const audio = $('#audio');
const progressSong = $('#progress')
function start() {
    render();
    handleEvents();
    loadingCurrentSong();
    activeSong();
}
start();

function render() {
    const htmls = songs.map((song, index) => {
        return `
        <div class="song" data-index=${index}>
      <div class="thumb" style="background-image: url(${song.image})">
      </div>
      <div class="body">
        <h3 class="title">${song.name}</h3>
        <p class="author">${song.singer}</p>
      </div>
      <div class="option" >
        <i class="fas fa-ellipsis-h"></i>
      </div>
    </div>
        `
    });
    playList.innerHTML = htmls.join('');
}

function handleEvents() {
    //scrolling
    const backgroundWidth = cd.offsetWidth;
    document.onscroll = function() {
        const newCdWidth = Math.floor(backgroundWidth - window.scrollY) ;
        cd.style.width = newCdWidth > 0 ? newCdWidth + 'px' : 0;
        cd.style.opacity = newCdWidth / backgroundWidth;
    }

    //playing song
    const player = $('.player');
    const playBtn = $('.btn-toggle-play');
    let isPlaying = false;
    playBtn.onclick = function() {
        if(isPlaying) {
            audio.pause();  
            isPlaying = false;     
        } else {
            audio.play();
        }
    }
    audio.onplay = function() {
        player.classList.add('playing');
        isPlaying = true;
        cdRotating.play();
    }
    audio.onpause = function() {
        player.classList.remove('playing');
        cdRotating.pause();
    }

    //Timelining handle
    audio.ontimeupdate = function() {
       if(audio.duration) {
        const progress = Math.floor(audio.currentTime / audio.duration * 100);
        progressSong.value = progress;
       }
       $('.left').innerText = timerFormat(audio.currentTime);
    }

    //Skipping video| 
    progressSong.oninput = function(e) {
        audio.currentTime = Math.floor(e.target.value * audio.duration / 100);;
    }

    //Next song
    const nextBtn = $('.btn-next');
    nextBtn.onclick = function() {
        if(isRandom) {
            indexSong = Math.floor((Math.random()* songs.length));
        } else {
         indexSong++;
         if(indexSong >= songs.length) {
            indexSong = 0;
             }
        }
        activeSong();
        currentSong = songs[indexSong];
        loadingCurrentSong();
        audio.play();
        scrolling();

    }
    //Prev song
    const prevBtn = $('.btn-prev');
    prevBtn.onclick = function() {
        if(isRandom) {
            indexSong = Math.floor((Math.random()* songs.length));
        } else{
             indexSong--;
             if(indexSong < 0) {
                 indexSong = songs.length - 1;    
             }
         }
        activeSong();
        currentSong = songs[indexSong];
        loadingCurrentSong();
        audio.play();
        scrolling();
    }

    //Auto next when ending
    audio.onended = function() {
        if(isRepeat) {
             audio.play();
         } else {
                 nextBtn.click();
                 }
       }
        

    // repeat the song
    let isRepeat = false;
    const repeatBtn = $('.btn-repeat');
    repeatBtn.onclick = function() {
        repeatBtn.classList.toggle('active');
        isRepeat = !isRepeat;
    
    }

    // random the song
    let isRandom = false;
    const randomBtn = $('.btn-random');
    randomBtn.onclick = function() {
        randomBtn.classList.toggle('active');
        isRandom = !isRandom;
    }

    //Click to the song
    const listSongs = $$('.song');
    listSongs.forEach((song, index) => {
        song.onclick = function(e) {
            const optionTarget = '<i class="fas fa-ellipsis-h"></i>'
            if(e.target.outerHTML == optionTarget) {
                alert(`Downlaoding ${song} ${index}`)
            } else {
                listSongs.forEach((song) => {
                    if(song.classList.contains('active')){
                        song.classList.remove('active');
                    }
                })
                if(!song.classList.contains('active') ) {
                    song.classList.add('active');
                    indexSong = index;
                    currentSong = songs[indexSong];
                    loadingCurrentSong();
                     audio.play();
           
                } 
            }
        }
    })
     

    //cd Rotate
    const cdThumb = $('.cd-thumb');
    const cdRotating = cdThumb.animate([{
        transform: 'rotate(360deg)'
    }],{
        duration: 10000,
        iterations: Infinity
    })
    cdRotating.pause();

    //timer
    audio.onloadedmetadata = () => {
        $('.left').innerText = timerFormat(audio.currentTime);
        $('.right').innerText = timerFormat(audio.duration);
     }

     //volume
     volumeBtn = $('.btn-volume');
     volumeBtn.oninput = function() {
        audio.volume= volumeBtn.value/100
     }
}
function loadingCurrentSong() {
    const heading = $('header h2');
    const cdThumb = $('.cd-thumb');
    heading.textContent = currentSong.name;
    cdThumb.style.backgroundImage = `url(${currentSong.image})`;
    audio.src = currentSong.path;
}

function activeSong() {
    const listSongs = $$('.song');
    listSongs.forEach((song, index) => {
        if(index === indexSong) {
            song.classList.add('active');
        }else {
            song.classList.remove('active');
            
        }
    })
}
function scrolling() {
    const activedSong = $('.song.active');
    setTimeout(() => {
        activedSong.scrollIntoView({
            behavior: 'smooth',
            block: 'center',
        })
    }, 300)
}
//timer
function timerFormat(duration) {
    const rounded = Math.floor(duration);
    return `${Math.floor(rounded/60) >= 10 ? Math.floor(rounded/60) : '0' + Math.floor(rounded/60)}:${rounded%60 >= 10 ? rounded%60 : '0' + rounded%60}`;
 }

